				["TX"] = "On a legion planet known as Baphala, Thoomawl used to be the captain of a platoon of demons consisting of felguards and other demons under the direct command of Jagganoth  the Annihilan. Baphala was a place of nightmares, fires engulfed most of the world and the small continents of rock were split by rivers of molten metal.\n\nThrough surviving here, the demon knew only  savage slaughter and wanton aggression, but also ambition which pushed him up the ranks very quickly.\n\nEnvious of Thoomawl's success, the Nathrezim known as Baphitheroc plotted to betray the felguard by coercing his soldiers and staging a coup aiming to overthrow Jagganoth and take his power. When Thoomawl was the only loyalist alive, the traitors turned to defeat him. Instead of backing down, Thoomawl battled them, slaying them all with his bare hands. His fury uncontained, he slew every demon on Baphala except for Baphitheroc who fled to the Twisting Nether.\n\nGleeful at the massacre, Jagganoth rewarded the felguard with a sword fashioned out of the molten rivers of Baphala. The titanic sword serves as a reminder to Thoomawl that the only way to kill your foes is to ensure that there aren't enough pieces left of them to reanimate. \n\nDuring the Third War, Thoomawl was sent to Azeroth to destroy the resistance of humans on Kalimdor, however, trapped in ice by an unknown Human Sorcerer, it was a decade before he was found by Aros and bound to his will through the power of the Codex of Avitus.",
