				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\BattlefieldFrame\\UI-Battlefield-Icon:64:64}\nFreyke Gravelheart is a dwarf in the sense of the word.\nLikes his ale and meade every once in a while but is loyal to the bone to his kin and the cause he supports.\n\nHe hails from a the Stormpike clan and has joined tracking groups and served some time in the mountain brigades before being transfered out.\n\nHe spent the last 10 years in the mountains where he was detached as stretcher-bearer second to his markmanship skills and has been trained in some medical practice with herbology as a side-note.\n\nAdjusting to the soldier life in a mostly Human outfit, he trains in secret to keep his muscles up to date since he requires more steps per metre to get to where he wants to be\n\nHe is trying to get to know everyone in the outfit to know who he can rely on in times of battle.\n\nOfficial Kill Count : 7\n",
