				["CU"] = "Thoughtful. Distant. Morose.",
				["XP"] = 3,
				["v"] = 81,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:5cff5f}{/col}{col:5cff5f}{h2:c}Bramblefur{/h2}{/col}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\nA massive beast-of-a-man, clad in leather, feathers, and a thick layer of cynicism.\n \n\nBramblefur, a man best described through his harmonious personality, is sure to always stand out in any crowd, whether he wants it or not. He sports slender shoulders, thin limbs, and somewhat of a broad chest, nothing too impressive when compared to most afflicted.\n\nA long square muzzle, aged facial features, and a powerful jaw make for Bramblefur's face. A face seemingly devoid of emotion and heart. His enlarged eyes and often forced smile do manage to create somewhat of a friendly expression, however.\n\nBramblefur makes himself appear as nothing more than an avid forest dweller. Yet he is no stranger to socializing and small-talk, and even sometimes prefers good old attention above everything else.\n",
				},
				["MU"] = "cataclysm\\mus_winterspring_gu04",
