			["character"] = {
				["CO"] = "Dainty Damsel is recruiting.\n\nCheck out our AA and/or whisper me OOC/contact IC\n\n",
				["RP"] = 1,
				["CU"] = "Slightly reddish jaw, sore back and shoulder.  ",
