			["about"] = {
				["T1"] = {
					["TX"] = "{h2:c}{icon:Achievement_ChallengeMode_Silver:85}{/h2}\n{h1:c}{col:575757}Lord Joshua T.C. Leopold{/col}{/h1}\n{h2:c}{col:939393}Joshua would be a young, Gilnean teenage male. He'd stand at an average height and would carry muscle over his body, a fair amount in the right places showing his athletic nature. He'd have short, raven black hair that would stretch over his scalpl. His right eye would be missing, often covered by an eyepatch made from fine leather it seems. Across the rigth side of his face, he'd also have a light burn mark. On his mouth, he'd have lots of scars going down vertically over his lips. He'd be a fair looking male, however, his scars may over-rule this.\nJoshua would carry the following scars:\n- His right eye would be missing.\n- He would have a burn mark along the right side of his face.\n- He would have both large and small scars, slashes and graises across his torso. A burn mark sitting on his lower stomach too. (Only can be seen if his top if off, obviously.)\n- Vertical individual scars running over his lips.{/col}{/h2}\n\n{h2:c}{col:11f297}  {link*http://imgur.com/LqYuPCu*Reference of Joshua!}{/col}{/h2}\n\n{h2:c}{link*http://jakeshields01.imgur.com/all/*Art of Joshua!}{/h2}",
				},
				["BK"] = 9,
				["TE"] = 1,
				["v"] = 48,
			},
			["zone"] = "Lakeshire Inn",
			["misc"] = {
