				},
				["PE"] = {
					["1"] = {
						["IC"] = "Achievement_ChallengeMode_ArakkoaSpires_Silver",
						["TI"] = "Appearance:",
						["AC"] = true,
						["TX"] = "Josh would be a young, Gilnean teenage male. He'd stand at an average height and would carry muscle over his body, a fair amount in the right places showing his athletic nature. He'd have long, raven black hair that would stretch over his scalp nicely, forming into a ponytail.. His right eye would be missing, often covered by an eyepatch made from fine leather it seems. Across the right side of his face, he'd also have a light burn mark. On his mouth, he'd have lots of scars going down vertically over his lips. He'd be a fair looking male, however, his scars may over-rule this.",
					},
					["3"] = {
						["IC"] = "Achievement_ChallengeMode_Scholomance_Silver",
						["TI"] = "Gear:",
						["AC"] = true,
						["TX"] = "Joshua would carry the following gear:\n- A millitary Gilnean combat knife sat on his belt, ready for use.\n- A sharp steel sword sitting in a hilt. Engravings mark the blade, only for decoration however. The hilt would be wrapped nicely with leather bindings for appropriate control and handling.",
					},
					["2"] = {
						["IC"] = "Achievement_ChallengeMode_ScarletMonastery_Silver",
						["TI"] = "Clothing:",
						["AC"] = true,
						["TX"] = "He'd tend to normally dress down in casual wear - padded with leather or a light steel breastplate under his shirt for protection. \n\nOr..\n\nHe'd be wearing a very well made, very expspensive Gilnean suit. It'd be made rightly for his body. Gilnean clothing at its finest.\n\nOr..\n\nHe'd be seen strolling around in armour. This armour would be a fine steel material, accompanied with chainmail underneath. The steel would be a fine dark grey colour, accompanied by a dark blue fur cloak hanging from his neck. A Gilnean theme hinted from the armour, very expensive and the top of its game it seems - mostly always clean.",
					},
					["5"] = {
						["IC"] = "Achievement_ChallengeMode_TempleoftheJadeSerpent_Silver",
						["TI"] = "Voice:",
						["AC"] = true,
						["TX"] = "Joshua speaks with a Gilnean accent. This would be the more posher accent however, hinting towards his good upbringing.",
					},
					["4"] = {
						["IC"] = "Achievement_ChallengeMode_GateoftheSettingSun_Silver",
						["TI"] = "Scars:",
						["AC"] = true,
						["TX"] = "Joshua would carry the following scars:\n- His right eye would be missing.\n- He would have a burn mark along the right side of his face.\n- He would have both large and small scars, slashes and graises across his torso. A burn mark sitting on his lower stomach too. (Only can be seen if his top if off, obviously.)\n- Vertical individual scars running over his lips, much like stitching.\n",
					},
				},
