		["01222141087ugR3"] = {
			["character"] = {
				["CO"] = "Feel free to RP with, if you need to trade, don't be afraid!",
				["RP"] = 1,
				["CU"] = "Quill tucked behind his right ear. A bright smile still on his face. Lira on his shoulders.",
				["XP"] = 2,
				["v"] = 23,
			},
			["time"] = 1496780294,
			["link"] = {
				["Hranthar-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 20,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}{p:c}{col:ebf3ff}Tay's hair is once again long and flowing, no knots, ragged ends and reaches near the bottom of his back, the hair colour remains the same.\nA stern looking male man, his eyes gazing out toward the world without a hint of care or kindness, his nose seems to have a ridge straight through the middle, broken at some point or another. Fresh scars can be seen on his cheek diagonally from left to right and one on his lips, straight scar on the right side.\n\nAgile and lean, a good specimen for a scout or runner, his body has wiry muscles rippling beneath a layer of tanned skin, parts of his skin seemed to have been burned on the lower arm on his left side, no longer afraid to show his hands, the skin itself is pockmarked and looks leathery with old burns covering the entire epidermas itself up to his wrist.\n\nHis personality seems to be one of carelessness, no longer caring for those who he once considered friends, weary to trust anybody and willing to use people and various \"unjust\" means to achieve his goals,  very observant of his surroundings. He possesses a higher level of hearing too.\n\nA sword and dagger is situated upon his person in two seperate scabbards on his belt, along with a dagger strapped to the inside of his boot, several pouches can be seen strapped to his chest and around his belt and a chest strap filled with throwing knives clasped at the shoulder.\n\nWorgen Apperance ->\nLooking darker than his human self and often not seen in this form. His Dark Yellow eyes stare out to the world with more ferality and a rather nasty and ravenous gaze. \nEach of his teeth filed to sharp points and his canines seem to be longer. His muzzle keeps the same ridge near the nose.\nHis body defined by dark gray fur all over, the wiry muscles seeming more defined in this form.{/p}{/col}",
				},
