		["0901223148p3Mez"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Anomalies & Features",
						["TX"] = "Narazda's has no Right-Horn.\n\nHer right eye appears as a human's; with a sclera, pupil and a light Purple iris.\n\nNaz doesn't wear any makeup, at all. She loathes the feeling of it on her face.",
						["IC"] = "Ability_Rogue_WrongfullyAccused",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Master Arcanist",
						["IC"] = "Spell_Arcane_ArcaneTorrent",
						["TX"] = "Narazda emanates a vastly powerful Arcane Aura at most times; deep-rooted in her blood and soul.\n\nThough her wielding of Arcane and Frost are raw and normal; she wields Pyromancy in the form of Leyfire.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Poor Example of a Draenei",
						["IC"] = "Ability_Rogue_SinisterCalling",
						["TX"] = "Narazda's speech pattern is VERY un-draenic; speaking with a Stormwindian accent, and often rather colourful.\n\nShe also barely speaks about the Light, and chooses to ignore most of her own culture.\n\nIf one heard her, but didn't see her; it's very easy to mistake her as a human.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "\"Surcoat of Victory\"",
						["TX"] = "Narazda dons a tabard that is clearly Sin'dorei in origin... for some reason.",
						["IC"] = "INV_Chest_Cloth_30",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Battlements of the Onyx Fae",
						["TX"] = "Her armour is lightweight plate-armour, forged of Argus Steel, Elementium and a Cobalt-Onyx Alloy. It is also resistant to Magic.\n\nHer blade, Ardor'ael Mk58, is pure Argus Steel; infused with raw Arcane Energies, with three runes affixed to it. Its hilt is forged from Arcanite.\n\nShe has a sidepack around her waist, with a Hipflask attatched. She keeps bits and bobs in it.\n\nA ring, forged of Jade, with Crystaline Mana running down its middle, sits on her left ring finger.",
						["IC"] = "Achievement_TheNighthold_SpellbladeAluriel",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 4,
					["4"] = 1,
					["6"] = 1,
				},
				["v"] = 59,
			},
			["time"] = 1496780951,
			["link"] = {
				["Narazda-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{icon:INV_shoulder_Plate_LegionEndGame_C_01:25} Physicality {icon:Ability_Paladin_SwiftRetribution:25}{/h1}\n\nNarazda is a tall, steadfast and strong Arcane Warrior; Master of the Blade and Arcana in equal measure. She is often seen wearing her Plate-Armour; a lightweight self-forged set of Argus-Steel armour.\n\nShe has a strong, beefy form; obviously well fed, well trained, and well kept. A woman who likes the simpler things, but knows how to keep herself in employment.\n\n{link*http://imgur.com/935Q1Yw*Artwork!}\n{link*http://imgur.com/a/H0xGi*More Artwork!}\n[See 'At First Glances' for more info!]\n\n\n{h1:c}{icon:Ability_Socererking_arcanefortification:25} Mentality {icon:Spell_Warrior_Barbarian:25}{/h1}\n\nA sarcastic, rambunctious and life-loving woman; Naz is very passionate about almost anything she sinks her teeth into. Protective and Friendly, she always does her best to keep those she loves safe.\n\nBehind the strong warrior bravado, Naz has a soft spot for children, more than willing to sacrifice and put herself on the line for them. She even wants a child of her own; however is unable to bear Children.\n\n\n{link*http://www.argentarchives.org/node/161125*Click here to read the full backstory!}\n(Otherwise, ask and learn!)",
