			},
			["zone"] = "Stormwind City - Stormwind Harbor",
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Like any other night elf, Auliera is relatively tall, compared to other races, though only average, if stood beside her brethren. She's very fit and is looking quite strong, despite her being quite slim, which is pretty common in all kinds of elves. Due to her relative young age, Auliera seems very energetic, always standing at the ready to do what must be done. Despite her being so lively, she looks very calm and conscious.",
						["BK"] = 3,
					},
					["PS"] = {
						["TX"] = "Due to her time training as a night elf sentinel, Auliera thinks twice before acting, but when she does, she does so with extreme precision. This of course implies her being really calm and conscious about her actions. She's quite neutral in many aspects of life, such as romance, but sometimes this neutrality shows only her will to make a decision not based on her subjective opinion, but on proved facts. Thus, should she find herself in a moral dilemma, she suppresses her feelings to find the best and most just solution. Lately she finds herself being more forward and open about her feelings.",
						["BK"] = 2,
					},
					["HI"] = {
						["TX"] = "There is little to note about Auliera's youth due to her being with the sentinels of Teldrassil. Due to her age, and the fact that night elves possess extremely long lifespans, many of her brethren do not yet consider her a full adult. Due to this, when she finished her training, she set out to prove her worth for her people, for the Alliance, and most importantly, for herself.\n\nDuring her adventures she happened upon a faction of soldiers, called the Knights of the Isle, whose aim was to retake Lordaeron for it's people, and lay waste to the undead hordes prowling the once great kingdom. Since she's been taught to respect nature, she's very much against undeath, with the Forsaken, she may cope for a short period of time, if really necessary, but she'll never allow the Scourge to exist past the point where she can do something about them. This, and that she thought this would be the perfect opportunity to prove herself, led her to join the Knights of the Isle in their righteous campaign against the armies of evil.\n\nHer time with the Knights met an unfortunate end, as their order was decimated by the agents of the Legion. This time, though scarred her, also changed her personality. After the fall of the order, she left off to rejoin her sisters and face the Legion at it's doorstep. Being unable to fit in the Sentinels after such a long time with a bunch of humans, although she mourned the loss of her sisters at the hands of the Legion, she also found herself more comfortable in the diverse crowds of Stormwind and the dangerous and beautiful sights of the world. Now she's determined to find her own way, by taking any opportunity of adventure that crosses her path, let it be through friends or fate.",
						["BK"] = 18,
					},
				},
