			["character"] = {
				["CO"] = "No god emotes - that includes armed to the teeth characters in a civilized area or godly Khadgar level spellcasting shit.\n\nPlease don't use any information you find here besides \"First glance\" and \"Physical Description\" as things your roleplaying character should know from the start.",
