			["about"] = {
				["T2"] = {
					{
						["TX"] = "Physical Description\n\nA well shaped, slim and developed tall body that surpasses even most sub-race men, with snow white skin color. \nPale blonde straight and soft hair accompanied by her icy blue\neyes make her northern genes very obvious",
						["BK"] = 1,
						["IC"] = "Achievement_Character_Human_Female",
					}, -- [1]
					{
						["TX"] = "Physical Damage, Mental Health & Scars\n\n- Fresh arrow wound can still be seen bandaged around her right shoulder on bouth sides. Only visible while wearing tight clothes like shirts or vests.",
						["BK"] = 1,
						["IC"] = "Achievement_Guild_DoctorIsIn",
					}, -- [2]
					{
						["TX"] = "Personality Traits\n\nVery perceptive and understanding personality towards her surroundings. Despite her beeing very civilized and \nelegant at times - she has a very radical and straight understanding of all things. Her raw understanding of\nthe order of nature helpes her remain sane and pass through the worst situations without her mindset to be\nweakened nor bent. \nA very valorous behaviour - she respects her ancestors and family above all else, a subtle yet strong belief in the \nlight, justified by her religious parents that she lost and a very honorable ideology.\nShe has a natural despise for the greedy, cunning, unrespectful, dishonorable, false, weak minded people and\nsuper-natural behaviours like alteration or illusion magic.\nShe will not interfere in any situation that won't disturb her personal being or mindset.",
						["BK"] = 1,
						["IC"] = "Ability_Paladin_BeaconofLight",
					}, -- [3]
					{
						["TX"] = "Passive Traits and Skills\n\nAverage cook skilled in ingredient gathering, hunting and skinning. Basic first aid knowledge and a good sense of\norientation.",
						["BK"] = 1,
						["IC"] = "Achievement_Garrison_blueprint_small",
					}, -- [4]
					{
						["TX"] = "Combat Traits and Skills\n\nHer combat skills shine in using a hunting bow. \nHer perceptionand concentration will allow her to remain precise with such weapons even in intense combat situations. \nHer hunting experience allows her to forsee primal instincts\non animal or human foe alike striking for weak spots with precision.  Her melee combat and dodging techniques are\nvery basic even though she has a quick sword arm and reflexes.",
						["BK"] = 1,
						["IC"] = "Achievement_RareGarrisonQuests_X",
					}, -- [5]
					{
						["TX"] = "Visible Weaknesses\n\n- Bandaged arrow wound around her right shoulder weakened her arm - unable to use it effectively.",
						["BK"] = 1,
						["IC"] = "Ability_Paladin_HandofLight",
					}, -- [6]
