		["0131054955wwdUU"] = {
			["character"] = {
				["CO"] = "Recruiting for The Altari.\n\n\nThe information below is just for me, so do not mind about it.\n11 bandits killed.\n9 cultist killed.\n3 worgen.\n3 undead.\n1 armored skeleton",
				["RP"] = 1,
				["CU"] = "Wearing a warden sigil.\nStern.\n1/3\n1/3\n",
				["XP"] = 2,
				["v"] = 43,
			},
			["time"] = 1496967127,
			["link"] = {
				["Broneron-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "                                               His life.\n \n\n                                   {img:Interface\\ARCHEOLOGY\\ArchRare-GenBeauregardsLastStand:512:256}\n\n\n\n  He was born 22 winters ago in the northeast region of Alterac.\n\n\n He was raised by his mother, since he didn´t meet his father, and she taught him everything he knows.\n\n     {img:Interface\\ARCHEOLOGY\\ArchRare-QueenAzsharaGown:512:256}\n\n Of half human half quel´dorei blood  Marcus has the appareance of an human and the reflexes of an Elf, despite his life is not as long as the elven people, he can live more than the rest of humans.\n\n When he was a kid, his mother taught him how to use the bow, move with furtiviness through the forest and  respect the nature.\n\n      {img:Interface\\Pictures\\artifactbook-hunter-thasdorah:512:256}\n\n His life was simple, wake up, have breakfast, study and hunt with her mother in order to keep living comfortably, because they were the only hunters of the zone, and supplied the village.\n\n His mother was the mediatrix when they sold the goods, until the leaving of the Quel´dorei from the alliance.\n\n Marcus was now the mediator with the humans, because they didn’t recognize him as an elf, he only have two pointy ears and soft and beautiful factions.\n\n At the age of 16, and by decision of his mother, Marcus joined a Caravan headed to the south with the company of a group of merchants, whom in exchange of Marcus protection they gave him a free seat.\n\n The reason of his departure was that his mother considered that his child was not living a good life..and due to not being accepted by the elfs because of his human heritage, she decided to send him with other humans, and order him to keep his ears hidden.\n\n Marcus after two month in the caravan reached stranglethorn valley, and decided to stay there, hunting the local fauna and improving his skills for 4 years.\n\n The last 3 years he has been hunting dangerous preys with bounty and collecting the rewards in the villages, he is a nomad, his house is with her mother.\n\n His mother returned with her people, and every 4 months, they meet.\n\n\n ",
