						["TX"] = "A mix of factions can be seen on his face, despite his marked jaw (propper of the human race) his skin is soft as the elfs, and two pointy ears can be seen.\n Long hair and blonde, when the wind blows it moves with some kind of..elegancy.\n  Green eyes with ambar tonalities, unnexpressive look if he wants to.\n  Soft lips covers a perfect denture, when he smiles he can be charming.",
