		["05291652150ZeZv"] = {
			["character"] = {
				["CO"] = "I'm not as melancholy as Audrey is. Any questions? Just ask!",
				["RP"] = 2,
				["CU"] = "Indifferent, aloof, poised.\n\nAbout as approachable as any other dead person.",
				["XP"] = 2,
				["v"] = 34,
			},
			["time"] = 1496776694,
			["zone"] = "Stormwind City - Lion's Rest",
			["about"] = {
				["v"] = 26,
				["BK"] = 5,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:8168b5}Audrey Downcast{/col}{/h1}\n{img:Interface\\Pictures\\artifactbook-deathknight-cover:256:256}\n\n{col:767676}Despite the aura of {col:349a2e}putrefaction{/col} {col:767676}surrounding her and the blatant necrotised pallor of her skin, it would be incorrect to call Audrey unattractive: she has an uncanny, haunting, almost disturbing pulchritude, especially amongst those with a morbid fascination for the dead and decomposed. Despite her skin being {col:cbe7e1}sickly pale{/col}, {col:767676}her cheeks gaunt and her eyes sunken, a naturally good bone structure has rendered Audrey agreeable to the eyes even in death, however it is notably clear that she hadn't been dead for long at the time of her second birth.\n\nThe first notable element of Audrey's countenance is her hair - where once lay a cascade of raven tresses now resides a tangled, confusing mire of starkly {col:1209bf}cobalt-blue hair{/col}. {col:767676}To the touch, it remains surprisingly silky, yet to run one's fingers through it would prove a challenge: it is matted and knotted, despite its otherwise smooth and glossy appearance. It is usually cut and styled sensibly, clearly a woman of practicality over appearance, and this trend remains to be seen across her entire form. Framed between those almost magical blue locks resides a gaunt, sickly face - pale skin seems almost stretched across the bone of her skull, though not in an unattractive or ghoulish fashion. She is devoid of any wrinkles, even laugh-lines, and thus possesses and almost doll-like visage, her neutral and somewhat frighteningly cold expression only serving to emphasise her nonchalance.\n\nOne would likely first note her eyes: those {col:69ddf9}runic orbs{/col}, {col:767676}cyan and glimmering, that sit in sunken and blackened sockets upon her face. She, despite her undeath, simply looks tired. Exhausted, even, and at all times - though the dead never rest, Audrey quite clearly needs a good night's sleep. She carries not a glare nor a glower, not even really a glimpse, but merely a vacant stare - quite like looking into the eyes of a corpse, truth be told, and a rather unimpressed corpse at that. Her eyes are capped off by a pair of wispy blue eyebrows, nothing interesting to note about them. Her nose is petite and concave, though it seems slightly offset to the left - evidently broken, yet unmended. Sat beneath that adorable-yet-shattered nose lie a pair of rather thin, forgettable lips - they are neither cracked nor smooth, merely folds of skin a fair shade darker than the rest of her ghostly, ashen hue. Of course, those lips always hold almost no emotion, save for a haughty and airy disinterest in everyone and everything. Her features are rounded off by a pointed chin and high cheekbones, stark contrasts to her sunken, deathly grey cheeks - were it not for the sheer lack of volume and the greyness of her flesh, she could likely have passed as pretty at some point.\n\nFlowing down beneath an elegant, swan-like neck - a dancer's neck - lie a pair of lissom, effeminate shoulders. Her musculature, most notably around the joints, is distinctly more sinewy and athletic than the average undead - her locomotion is not born of unholy magics and foul necromancy, but by simple training in her first life that has luckily carried over into her second. Her biceps neither bulge nor ripple, but simply exist - faint lines indicate the difference between bone and muscle, though her skin is so remarkably unblemished as to look like a coating of ice wrapped around a sack of organs - no real distinction between any one part of her musculature is visible. Her hands are petite and feminine, though the palms are a fair shade larger than usual - they are clearly hands suited for fighting, not for domestic work. \n\nHer body, once again, is lissom, lithe and uncharacteristically average. Little to no padding nor fat covers her frame, she is merely gaunt, wiry, skinny. Her bosom is neither large nor small, it simply exists - as is the norm with females of any species. It doesn't ripple nor quake, nor is it hugged and strapped beneath her armour - it is just present, not absent. Below this, the vaguest lines of abdominal muscles exist - though they are offset by the distinct outcroppings of her ribcage, giving rise to the notion that she may not possess chiselled abdominals, but merely has no adipose left to cover them. Her back is equally untoned and yet defined, all of the muscle mass beneath her moon-white skin visibly warping and shifting along with her more strained movements, though curiously it seems that almost none of Audrey's actions garner a response from her muscles. Everything seems effortless, as if her body merely exists as a means of bipedal ambulation.\n\nHer legs are longer than her torso, with an unhealthily thin waist and moderately flared hips - again, good bone structure - giving her a distinctly sporty build, one of a runner or swimmer. Her rear isn't full, despite that being the norm, nor perky - it's just there, two glutei maximi capped off with a - thankfully - matching pair of quadriceps, as biology would dictate she should have. Her thighs are neither juicy nor thin, simply womanly - perhaps the last vestigial hints of a charming, demure and comely appearance during her first life. They are joined by stiff, creaky knees to a pair of shins and calves, her milky-white skin stretched over the muscle mass beneath to create legs that are neither creamy and lascivious nor uninviting or lanky - they're just a pair of womanly, acceptable legs. Capping them off are a pair of averagely-sized feet, very rarely exposed, and with nothing special to note about them. She has all her toes, and she doesn't bother to paint them - the undead have little time for fashion sense. \n\nOverall, Audrey appears to be a taut, sinewy monolith of pallid, ivory flesh - skin stretched over muscle, an average-at-best face and a body that few women would wish for, and fewer still would ever have. The doll-like beauty of her countenance in juxtaposition with the noticable strangeness of her proportions and features gives Audrey a rather uncanny, unnatural and uninviting appearance - any who look at her, especially the more squeamish of the living, may find themselves repelled. Those with a curiosity about the process of putrefaction and decay need look no further - Audrey is, at once, the perfect case study as well as a decent conversationalist - one merely has to catch her fleeting, flitting interest.\n\n{/col}",
				},
