			["about"] = {
				["v"] = 79,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Appearence{/h1}\n\nTyriq is a man of average height with a skinny yet faintly muscular build. He has  long strawberry blonde hair that is put up in an untidy ponytail with the silky smooth hair reaching halfway down his back, forest green deep-set eyes, softly pink colored full lips and a subtle button nose. His delicate facial structures and smooth skin reveal that he’s a young man in his early twenties. He doesn't have much bodyhair and keeps his face clean shaven.\n\n{h2:c}Personality{/h2}\n\nA long and troubled past has made him patient and kind to those around him, not wishing to make them feel lonely or unappreciated as he once felt himself. He is openminded and doesn't strive to fit the norms of a man, dressing and wearing his hair the way he wishes. He's unlikely point out traits of others unless it's something rare, as he sees no reason to comment on peoples appearences. \n\nHe can also be childish as he enjoys spending time with his children and taking joy in their activities such as drawing. He's also a candy lover and always carry some with him.\n\nStubborn and naive goes hand in hand, he regularly rushes into situation without plans and is determined to sort the mess afterwards. Coupled with being emotional whether he is happy or sad, he easily gets overwhelmed.\n\n{h1:c}History{/h1}\n\nHe was born in Redridge Mountains to Kathleen and Winthrop Ephraim, both living in the outskirts and seldom visiting town, few people would have known of him while he was growing up. He also has a five year older brother, Ezra Ephraim, but they were seperated shortly after Tyriq was born and didn't grow up together. In present times, both his parents are deceased.\n\nBecame a father at 16 to Vincent, 15th April. \nBecame a stepfather at 21 to Connor.\n\n{img:Interface\\QuestionFrame\\answer-InnAlliance:512:256}\n\n{h1:c}OOC Notes:{/h1}\n\n{link*http://i.imgur.com/lilzmM5.jpg*Appearence reference}\n\nGrappling hook and stealth is OOC. Running is IC.\n\nTheme song: You'll be in my heart (Disneys Tarzan)\n\nVincents stuffed dog is called Doggie. (i'm a horrible parent and forget)",
