				["T1"] = {
					["TX"] = "Sadie is a youthful looking gnome in her young-adult years. She stands at average height for her race, at just under three feet tall. She has a stocky build and is in decent physical condition, but clearly isn't overly athletic. She has very long brown hair, about two thirds the length of her body, which is always kept neatly tied back in a ponytail. Her emerald green eyes are big and round, and always looking for adventure and excitment. Her large ears are pierced in numerous spots, but she usually only has a few earrings in at a time. Her face is complimented by a bright smile, which she carries most of the time, and she almost never appears to be brought down by any complexities in her day. Sadie's skin appears to be relatively blemish free, indicating she has not seen a whole lot of action. However, Sadie's soft features belie her martial prowess, and she is more capable of defending herself than she may appear at first glance.",
