						["TX"] = "Gar changes her outfits quite often, yet there's one thing she NEVER seems to walk around without - her trusty overcoat. It's always draped over her pudgy shoulders casually, covering her arms and shoulderrs no matter how revealing her outfits may be.\nThe overcoat itself is black (Or maybe very, VERY dark grey) and has multiple golden buttons and decorative pieces attached to it. Shineh!",
