					},
					["3"] = {
						["IC"] = "inv_misc_potionsetF",
						["TI"] = "Odd smell!",
						["TX"] = "She smells weird. W E I R D. \nHowever, it's not the \"hobo from the old town\" kind of weird, no. Despite it's uncannyness, the smell surrounding Garselle is far from being the worst smell on Azeorth. It  appears to be a combination of various high-end perfumes, candles and... milk? Weird!",
						["AC"] = true,
