					["2"] = {
						["AC"] = true,
						["TI"] = "Your manners are your beauty",
						["TX"] = "Her body language can only described as \"animalistic\" - rapid short movements mixed with slow, shaky ones, randomly mashed together. Her gaze falls under the same \"category\" too - she looks at people around herself carefully, as if they were a threat to her. Despite all this, if approached, The worgen would appear surprisingly calm, and even polite. Sometimes she'd even forcefully soften her overly-raspy voice for the sake of her interlocutor's comfort, despite the physical pain it brings to her.",
						["IC"] = "Ability_Druid_PredatoryInstincts",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "\"EXTRA THICC\"",
						["TX"] = "This particular canine being appears to be fat! In fact, she's bordering morbid obesity! The side-effects of her eating habits are displayed on her body fairly well: her gait resembles more of a waddle, and she is often seen sweating, out of breath, or both. With every movement, a ripple is sent down her oversized rounded body, making various parts of her physique jiggle awkwardly.",
						["IC"] = "inv_misc_boarshead",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Thimbled fingers and jewelry,",
						["TX"] = "Upon closer inspection, it appears that... DUN DUN DUUUN! SCANDALOUS! Garselle is missing her claws! All of them! Instead, tips of her overly-long chubby fingers appear to be covered by a set of shiny golden thimbles! It seems like she's been wearing them for quite a while, since each thimble is covered in multiple scratches and slight deformations.\n\n(FOR THE SAKE OF REFERENCE TAKE ELIZABETH'S PINKY THIMBLE FROM BIOSHOCK AND MULTIPLY IT BY 10)\n\nAside from that, she usually wears a LOT of jewelry. Rings, necklaces, earrings, bracelets, multiple pairs of watches and engraved belts. Most, if not all of them, look rather expensive. \nHowever, the worgen doesn't seem to care much about it, as if she only did it to satisfy a niche fetish of hers rather than show her wealth off. The way she wears her \"stuff\" is rather confusing and somewhat original. One could even call it borderline unconventional.",
						["IC"] = "INV_Scarab_Gold",
					},
				},
				["ST"] = {
