						["BK"] = 1,
						["TX"] = "Gilnean-born Rebecca (Who more often goes by the name 'Becca'), spent most of her early years on a ship which docked from county to county. Ever since setting foot into the big city of Stormwind, she decided to make a life for herself, or try to, by doing what she loves.\n\nShe grew tired of saltwater and fish, and wanted to be part of something much bigger, and more exciting. With her trusty flute and songbook in hand, nothing can stand in her way.\n\nOr, so she thought.",
