		["0212032057DxrQT"] = {
			["character"] = {
				["CO"] = "Hello there! \nAlways happy to RP! \nFeel free to prod me OOCly too. ",
				["RP"] = 1,
				["v"] = 1,
				["XP"] = 2,
				["CU"] = "Feeling magical.\n34/34 HP 180/180 Mana",
			},
			["time"] = 1496527127,
			["link"] = {
				["Cyan-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 56,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}{col:fcbaff}\nThough Azeroth is a world of wonders, it all pales in the shadow of the great beyond. A place where reality meets make belief; the Twisting Nether is the domain of unbound, primordial magic. It is the great vault of countless secrets, some serving as keys to heights beyond the limitation of the mortal mind. This temptation of infinite power is nigh irresistable and there are those who will stop at nothing to unlock the potential of these miracles. To change the way the river flows. To move the greatest of mountains. To be the master of life... and death. \n\nCyan is such a woman, one who embraced the teachings of magic and seized power beyond her mortal boundaries. Yet for every fire she sparked, she would not be satisfied. No arcane knowledge under the tutelage of others could ever sate her desire for more. One day, she set out on her own, passing one stepping stone after the other while stopping at nothing to follow her pursuit. Many years later, Lady Avenfall yet treads Azeroth. The years have done naught to quench her flame, for it now burns brighter than ever.\n\nWith icy determination, Cyan now sets forth to seize her destiny. She wanders the world, shrouded in simple yet elegant robes. Though the years have drained the pigment of her silvery locks of hair, it has done little to the rest of her body. Yet in her prime, Cyan possesses a smooth, heart-shaped face. With curious and inquisitive shamrock eyes, she studies the world around her. Below them, you'll find her ever forward-looking nose, soft and low-bridged. It towers just above her warm, typically gloss-glazed lips that find little difficulty to share a gentle smile.\n\nTrailing down her figure, her robes leaves much to the imagination, yet a prominent hourglass figure is no secret. It takes a fool not to presume that a life of studies has deprived her of significant physical strength and dexterity. Neither does whatever little bare skin she chooses to show display any signs of blemishes. Neither toll or warfare has influenced her body, producing the smooth qualities of a lady at court.{/col}\n\n{col:63c2ff}Cyan's character sheet: \nHuman: + 1 Charisma\nMage: + 10 Mana\nEvoker: +2 AC / +1 DMG\n\nLevel 8: 1950/7500 EXP  \nHP: 34\nMana: 180\n\nStrength:      8    (-2)\nDexterity:     8    (-2)\nIntelligence:  26  (+8)\nWisdom:       20 (+5)\nConstitution:  10   (0)\nCharisma:     11   (0)\n\nBlock:             10  \nDodge:             8  \nMagic Resist:   15\n\nAspects:\n\nPower Conduit: Mana surges through you at tremendous levels, causing a power spike when you're overflowing with mana. On the contrary, this need for magical sustenance causes a drop in power when you're low on mana.  +4 damage at 67-100% mana, 0/0 at 34-66% mana and -4 damage at 0-33% mana. \n\nSpellcrafting: \n\n{/col}",
				},
			},
