						["IC"] = "ABILITY_MAGE_INVISIBILITY",
						["TX"] = "Cyan's affinity for magic is certainly no secret. Her very identity screams sorcery and witchcraft; always favouring a grey emblazoned gown and veil to fit the part!",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Physiognomy",
						["TX"] = "Though clearly elderly in hair and demeanor, Cyan's body struggles to catch up. Through magical means, the sorceress preserves her youth to the best of her ability, ever in her prime. A smooth, heart-shaped face welcomes soft and warm features, giving Cyan an overall friendly appearance.",
