				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Appearance{/h1}\n\n\nAraidah is, despite being a Death Knight, often described by people as 'a beautiful poison'. Getting involved with her on a whim would be a serious mistake. Her hair is long and a dark blue. Her skin all over is pale and cold to the touch, matching with her cold hard dead eyes. They glow a pale blue and some people would feel scared of the way she looks at them. She looks on edge most of the time, which makes some people feel awkward around her, wondering if she's about to tear their arms off or just glancing their way.\n\nHer lips are full, rosy and dark, like the contrast between her hair and skin tone. Looking down her body, she is not typical. Smallish breasts sit on a slim, tall and slender frame, her limbs just like the rest of her body are not muscular. She does however move in a way that suggests physical strength.\n\nHer high cheek bones do little to hide the fact she's a Death Knight, the usual gaunt expressionless face is present until she would snarl at her prey.\n\nAraidah's armour and/or clothing would appear exactly as it is ingame, neither brand new or badly damaged suggesting she has seen plenty of action in her time and can handle herself without complication. Her bare body would be void of wounds or scars, suggesting her death was non violent.\n\nWatching Araidah move would be like watching a cat move when it's stalking. Definite purposeful yet fluid movements and she walks with a stubborn confidence.\n\n***DISCLAIMER: Araidah may appeal to you sexually but I am NOT interested in ERP with you or your character(s). Don't bother to ask me for it either. I may not RP a Death Knight 'correctly' by your book, but I'm working from my book because it's MY subscription and I do not force you to RP with me.***",
