						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "He's witty, affectionate, brave but has somewhat or a rough side if ever underestimated feeling like he has to prove himself. But there's more than this to somebody with his position.\n\nHe was born in an ordinary family in Lakeshire. He lived happily until he was about 14 years old, but at that point life began to change.\n\nHe did a lot of small jobs and was learning a lot of new skills. After an astonishing adventure, he reached the top in a wonderful world. But with his perseverance and wisdom, there's nothing to stop him from reaching full potential. He could quickly become a true friend for life.\n\nBut anything could happen; he is currently still finding the right place in the world. He feels like there's more to enjoy in this world. Luckily he has wise teachers and great friends to support him",
						["BK"] = 11,
					},
					["HI"] = {
						["TX"] = "Ove always wanted to become a hunter in his younger years, but his father pushed him to carry on the Paladin name. Trying his hardest to make his father proud Ove left Lakeshire and befriended a Draenei named Ralphsson and he quickly became his right hand man, together they started a bond called ' Friendly Handholders ' with the purpose of ever being at service to who they deem worthy of help. Now they travel the world trying to fulfill some sort of destiny.",
