		["0112165600iqe1-"] = {
			["character"] = {
				["CO"] = "",
				["RP"] = 1,
				["v"] = 62,
				["XP"] = 2,
				["CU"] = "",
			},
			["time"] = 1496847386,
			["link"] = {
				["Andren-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "Andren Stone. On the first glance, one could see that he is quite tall. Standing at a solid height of 6'5. A pair of broad shoulders and thick arms would suggest that he works or lives physically. A certain look of a fighter might linger at the man, but not just because he carries a sword. Since most of the population does such, these days.\n\nOn a closer inspection, it would be his eyes that come in attention. A pair of dark, deep and piercing blue orbs, set to wander vigilantly around man's surroundings. A cerain spark of adventure is set in them, but same time where once he might have boyish enthusiasm and youthfulness to the world, it's replaced by something darker, cynical as he holds his brows often narrow.  \n\nHis facial features are sharp. High cheekbones, firm jawline. His lips are thin and often the man grins from the right corner of them. A woflish grin, revealing just few of his teeth in the process. Sometimes it might even come out in more then not appropriate situations. Where he's facing danger or something not as good happens around, but still the \"charming\" grin spreads across his lips.\n\nAs to what equipment and clothing Andren carries. Well. That really depends on when and where and with whom. From rags and a lot of leather, fur equipment, to full plated armor. Mostly he does enjoy himself in more lighter clothing, being agile and quick in those. But again, it depends on the location and reason. As sometimes those heavy battle suits are just required to stay alive. \n\nWeapons - quite similar as with armor. Does he have a collection of swords or simply picks one best for the job? Who knows. While it's a one handed broadsword that mostly remains at his sword-belt, it can change to a longsword, shortsword or even a claymore or two handed one slung across his back. Sometimes even a knife or dagger can be seen here or there. But never a firearm, however. \n\nAll in all. Does he stand out from most of the other human men in the city? Plenty of tall, broad soldier types. Plenty of armed and armored sellswords, soldiers and other filth about. The man is certainly no noble, but just a common person without fancy titles. Maybe he's average, maybe his personallity works up for it. ",
				},
