						["BK"] = 1,
						["TX"] = "Beneath the hulking plates of metal protrudes a full and very long black beard. A full nose set in between a pair of piercing deep dark blue eyes that seem to take you all in, not missing even the tiniest of detail. Eyes that have seen many a thing to make a life whole, and perhaps a few too many things that one would rather not have seen: wisdom through years of hardship. Then you notice the calm and friendly smile that hides beneath the beard.\nSturdy limbs set to a solid frame and everywhere, where the metal plates do not cover his body, you can see bulking cables of muscle. A mixture of different hammers at his belt and one in hand, as he turns to peer besides him at something or other, a sturdy shield and a sheathed blade at his side.\n This is one dwarven epitome of his race; metal and stout beer or ale, the only thing missing is a kiln with glowing embers, and he strolls on with surprising speed for such a small man.",
