					["TX"] = "{img:Interface\\Pictures\\artifactbook-mage-cover:256:256}\n\n{h1:c}{col:5cffd1}Vahlira Edelweiss Beaulieu{/col}{/h1}\n\n{p:c}{col:47adc1}The lively, and youthful woman who stands before you owns cheery features. Her icy blue orbs offer warmth, and comfort. Yet, her eyebrows suggest she's more serious than she tends to be. Her form is dainty and petite, yet some may notice her curves. Adorning her back and stomach lie light scarring. The rest of her body is clear, with little to no markings. To Lira's scalp is a mane of almost honey blonde hair, flowing past her ribs, and of course, well kept. Many have described Vahlira's hair similar to cat eyes; calm, yet alert. Her skin is tanned, but still very light compared to many others, it's nothing unique. Her lips plump, but not overly so. As a whole, this woman is basically the face of youth, but not child-like. Even someone of her stature, she's known to act taller, her chin held high with pure confidence.\n\nThis is a woman of intellect, a woman who holds a smart-arse like tone.{/col}{/p}\n{p:r}{col:1f8969}Visual ref: Taylor Hill.{/col}{/p}",
