						["TX"] = "Kind and compassionate to them he finds intriguing enough, Dante very well knows his place amongst others, even if at times he'd seem at a loss for things to say.",
						["BK"] = 2,
					},
					["HI"] = {
						["TX"] = "Born to an average Gilnean family, Dante first witnessed the brutality of the worgen curse as his father's affliction grew more dire, eventually making him feral and butchering Dante's mother, disappearing from the residence never to be seen again. This drove Dante into diligent studying of the mind in specific, to find a way around the 'feral issue'. Instead of finding a way around it, Dante instead strengthened his place as a cerebromancer, using his aqcuired knowledge to mostly try and assist his friends and fellow alliance members. After more recent events, he once more seeks a place to find purpose in. (More detail can always be found out by RP itself!)",
