					["TX"] = "This strikingly tall and athletic kaldorei clearly has little time for the more delicate notions of elven femininity, her battle-honed physique and graceful, clipped movements making for an imposing presence. Despite the nasty scar running from jaw  to chin across the left side of her face, there is something winning about her features - a certain nobility in her baring and generosity in her full-lipped smile. Her milk-white hair - streaked here and there with the pale blue of her younger years - is most  often pulled back into a sleek ponytail.\n\nWhile her somewhat terse manner is clearly the result of centuries spent in the Sentinel army, it is diluted by something of a devil-may-care glimmer in her lone, bright white eye. As well as the traditional markings of the claw on  her face, she bares an extravagant tattoo of a screech-owl across her collarbones, flanked by druidic runes. Embellishing the chest of her utilitarian - but well-made - scale-mail armour, are stitched numerous military commendations and insignia. She carries herself with a certain swagger - as you'd expect of any elf with the panache to wear a raptor claw hanging from her right ear.\n\nThe rifle  slung over her back is a thing of beauty - polished dark wood buffed to shine like jet, the shaft delicately carved with an invocation of Elune. \n\nAn unforunate byproduct of her penchant for thick dwarven cigars, a somewhat musty and smoky odour drifts around the Amazonian kaldorei.",
