					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "Before you stands a tall and muscular man. At first sight he might even scare you a little if you happen to run into him in a dark alley. \n\nNelson always moves with a certain pride, yet not arrogance. Chin up and his back straight is not uncommon.\n\nUpon taking a closer look you would notice that Nelson has a resting bitch face which only dissapears when he smiles. Several small and faintly visable scars decorate his face. Seems like he got lucky quite some times already. \n\nLooking slightly downwards a scar would be visable on his neck. Most likely a knife was held against it with great pressure.\n\nEven further down more scars are hidden under his armor and clothing which decorate his strong and muscular body, nothing visable with clothing on though.",
