		["0401170209nb063"] = {
			["character"] = {
				["CO"] = "Approachable\n\nRecruitable\n\nGhost wolf/Water walking/Running is IC\n\nNot glowing ICly\n\nEnjoys cuddles and hugs, may bite back! (:",
				["RP"] = 1,
				["v"] = 57,
				["XP"] = 3,
				["CU"] = "Doing better.\n\nTail is swaying from side to side",
			},
			["time"] = 1496946428,
			["link"] = {
				["Missellié-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:ff00ef}Hi! You stumbled onto my about section huh? >.>\n\nWelcome. If you want to learn the history of Reilia, you'd be better off asking her (: I don't particularly enjoy talking about the history of my char or something about her that people shouldn't know OOCly. Breaks immersion. (: \n\n*I will sometimes break that rule within reason*\n\nGhost wolf/Water walking/Running is IC, Armour/Weapon not glowing ICly - Unless I've stated otherwise!\n\n\n{link*https://www.youtube.com/watch?v=vi7wzz9kXxg*Theme or just a song I love, or both?<3}\n\n{col:ff00ef}\n\nIn case you clicked here and wanted to read my first glances, here they are but in my about section!:\n\n\n\n{h1:c}{col:ff00ef}Jewellery{/col}{/h1}\n\n{h3:c}\n\nThis Draenei would have lots of jewellery about her person.\n\nRight Hand:\n\nTwo rings, one on her index the other on her ring finger. \n\nThe ring on her index finger is of gold colour. On top of the ring sits a small plate, on the small plate is the emblem of a tear drop engraved into it.\n\nThe ring on her ring finger is a silver colour, inside of the band, in four different points (square shaped around the band) are small arkonite crystals, purple and bright.\n\n-------------------------\n\nLeft Hand: \n\nOne ring on her middle finger, silver, bearing the insignia of the Alliance.\n\n-------------------------\n\nTail:\n\nOn this Draenei's tail would be a few golden and silver bands. At the very base of her tail would be a golden band, going in a series of silver to golden, until the tip, where it ends with a golden band. \n\n(Total of four golden bands and three silver bands. Two of the golden bands starting and ending the sequence).\n\n-------------------------\n\nNeck: \n\nA leather strap, with a flat stone pendant threaded through the strap, hangs from ths Draenei's neck. Upon the pendant is an engraved wolf paw.\n\n-------------------------\n\nTendrils:\n\nOn this Draenei's tendrils are rings, engraved with small arkonite crystals, same as the rings on her finger however these are thicker and clamped on rather tight. \n\nOn her outer two tendrils are three of these golden rings. \n\nOn the inner two tendrils are two golden rings. Spaced out equally down the length of her tendrils\n\n{/h3}\n\n{h1:c}{col:ff00ef}Bags & Pouches{/h1}\n\n{h3:c}\n\nUpon this Draenei's belt would be:\n\n-Fist weapon (if shield/armour is IC)\n-Carving Knife\n-Multiple bags, containing different things\n-Two totems\n\nThe bags on this Draenei would hang from her belt. All containing different kinds of things, be it to medical equipment, herbs, spices, books...\n\n{/h3}\n\n{h1:c}{col:ff00ef}Wolf Head & Features{/h1}\n\n{h3:c}\n\nWhen wearing her wolf head, there are slits, cut out in the eyes. That is how she sees through, though her vision isn't -that- skewed.\n\n-------------------------\n\nThese Draenei's lips would be coated in a red lipstick.\n\n{link*http://i.imgur.com/yhYBVyv.jpg*Red lipstick reference picture}\n\n-------------------------\n\nThis Draenei's fingernails would also be painted the colour blue, similar colour to her skin.\n\n{link*http://i.imgur.com/iPoXCKh.jpg*Blue fingernails reference picture}\n\n{/h3}\n\n{h1:c}{col:ff00ef}Aura{/h1}\n\n{h3:c}\n\nAround this Draenei would be an aura and a feel of warmth. As if she is radiating the light.\n\n{/h3}\n\n{h1:c}{col:ff00ef}Tendrils & Tail{/h1}\n\n{h3:c}\n\nThis Draenei has four tendrils, two on either side of her body, extending from her head down to her bust. Reaching to 0.8 foot (9.6 inches or 24 cm).\n\nHer tail would be rather long, stretching to 7'3 (7 foot 3 inches or 87 inches or 220 cm)\n\n{/h3}\n\n\n\n\n\n\n\n\n\n\n\n\n",
				},
