						["TI"] = "Tendrils & Tail",
						["IC"] = "Achievement_Character_Draenei_Female",
						["TX"] = "This Draenei has four tendrils, two on either side of her body, extending from her head down to her bust. Reaching to 0.8 foot (9.6 inches or 24 cm).\n\nHer tail would be rather long, stretching to 7'3 (7 foot 3 inches or 87 inches or 220 cm)",
