			["about"] = {
				["v"] = 24,
				["BK"] = 18,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Henry North{/h1}\n{h3:c}The Greenseer{/h3}\n\nIf you happen uppon this slightly eccentric creature wandering through the forests or during his rare trips to the city, you'd be likely to assume that he's feral. His blue, piercing eyes have a predatory gaze that often scans his surroundings intently. It's not rare to find dark rings around his eyes even in his human form -- it's as if he's perpetually tired sometimes. Along his neck is a shaggy, roughly groomed mane of jet black fur, just a tinge darker than the standard coat covering his entire body. It almost has the appearance of a beard, except it doesn't stop at his cheeks, going all the way around his head and neck. Like the rest of his kind, he has a full row of razor-sharp fangs lining the inside of his mouth, and they're clearly visible even with his maw fully closed, making him look like he's almost always snarling.\n\nAs for the rest of his body, it's fairly typical for one of his kind. He's relatively tall, with an agile look to him -- at least, as agile as Worgen get. And that's not just an impression; Henry can move more than quickly when he has to. One noticable feature is the pair of iron claws on his right index and ring fingers. And of course, sticking out from behind his back is the long wooden staff he almost always carries, carved with strange runes that would likely be unintelligible to anyone who isn't a druid.\n\nHis accent is fairly typical for a Gilnean -- heavy, clearly distinguishable from the rest of the Alliance, and with a hint of Northern Gilnean mixed in with his typical noble accent.",
