				["T1"] = {
					["TX"] = "A girly figure, childish yet fully grown, is the frame in which Jennifer lives. A thin layer of well-balanced make-up decorates her youthful visage, enhancing every feature that makes her look young. \n\nWith eyes as bright as an elf’s and as large as a gnome’s, Jennifer radiates with a bubbly and bright spirit, forever optimistic; Perhaps naïve. Although she scarcely ever leaves home without make-up, her joyful demeanour persists in spite of the occasional lack of grooming and caring for her looks.\n\nShe has the shape of a pear, plump at her waist yet narrow and thin by her chest and shoulders. Her flat chest only adds to the childish appearance, but it is well compensated by the rest of her figure.\nAlthough she may act like a lady, it is clear that her wits are lacking. Her act most often fails impress, turning out as goofy and clumsy – after all, she is but a tailoress.\nFinally, Jennifer walks with a limp, consequently favouring her left leg. \nHer strut looks pained and troubled, yet she pays no heed to it - the hobbling seems entirely habitual.\n\nCommission for reference: http://tinyurl.com/JenniferReference",
