						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "A formal looking draenei lacking in the natural grace of her kind, yet holds typical draenic features in her sweeping horns, dimly glowing eyes and a narrow tail hanging behind her thick thighs.\n\nAlincials body is that of an agile soldier - supple limbs backed with athletic braun which lends an appearance of tight skin over compact muscle - biceps, shoulders and abs well defined in particular. Her body is trained and toned to high physical fitness, supporting a heavy bust and strong rear without over proclaim but clearly with a measure of quiet pride in her (usually) formal presentation.\n\nShe carries herself humble to the point of modesty, with neat uniform and demure ponytail of ashen grey, tied and held back from her eyes.\n\nAlincials posture is often squared and stoic, her eyes with their cold glow and calculating stare constantly assesing her surroundings and scrutinising those within for fault and value alike. She comes across with a distant air of military formality, calmly spoken and with a natural quiet confidence; welcoming and well mannered with that polite, affable smile.\n\nMore often than not Alincial covers her hands with gloves of some sort, be they light riding gloves or sturdy leather that clings tightly around her fingers and forearms. Despite an innate distaste for jewerly, she does wear a simple necklace of leather cord and magatama bead. A simple pair of modest silver rings sit pierced in her ear lobes.\n\nAlincial proudly sports a golden wedding band on her ring finger.",
