			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}Text Description:{/h1}\n\n\n{h2}Shonn is a human male around 180 centimeters of height; an age estimate could suggest late thirties.\n \n\n\n   A cascade of well ordered and combed, oft channeled into a ponytail - sporting here and there rare grayish threads in the flowing ocean of shimmering raven dark weavings of hair - crowns, and encases in two locks, an ample forehead carrying the marks of maturity and concern, slightly ploughing horizontally, three wrinks would be almost invisible, except when exhalted by flesh wrinching.\n \n\n\n   Matching the colour of the hair, the eyebrows rest like arcs dominating in neat contrast of chrome his glacial azure eyes, resembling in their icy gray-azureness mix, endless wastelands of frozen infinity; an infinity that mirrors the quiet and calm perceived through the irises, severe and inscrutable curtain of anything crossing his mind.\n \nHis facial hair, cared and kept in check almost on a daily basis in civil environments at least, encircle like a picture frame his lips, softest spot of a skin that seems hardened by the environment and the weather; the undesired design of a horizontal scar makes its appearance over his right cheek, sinking into it, for the flesh never regrew and it turns into a small rift into his visage.\n \n   When the neck is exposed, at the roots of it, where it merge into the shoulder, another scar can be seen, descending under the garnments, armour or whatever he'd be dressing at the moment. Though this one, seems very old, noticed only by a different skin chrome.\n \n   If you'd happen to see him without or more revealing clothing, the most of chest, both frontally and backward, sports a multitude of scars, overlapping and crossing in their patterns, some more lenghty than others. Some on the back seems made by lashing, than edges, eventually hinting a timeline of captivity or worse in enemy hands.\n \n   His hands, when exposed, clearly shows the hardenings due to extensive weapon or working tools usage.{/h2}\n\n\n{h1:c}History:{/h1}\n\n\n{link*http://www.argentarchives.org/Shonn*What is publicly known on Shonn Bayerleyn, can be accessed by anyone enterprising a journey to the Halls of the Explorers and Knowledge of Ironforge, where the Argent Archives are.}\n\n\n{link*http://www.argentarchives.org/node/54926*Among his individual feats, Lord Shonn Bayerleyn has been the Champion of the 3rd Edition of the Eastvale Tournament.}\n\n\n{h1:c}Household Information:{/h1}\n\n\n{link*http://bayerleyn-retinue.enjin.com*Public information on House of Bayerleyn are accessible at any recruitment office of the Alliance Army in Stormwind and provinces of the Kingdom. Both informative papers and enlistment modules.}\n\n{h1:c}Artwork Links:{/h1}\n\n\n{link*http://bayerleyn-retinue.enjin.com/gallery/m/20022497/detail/177249#pid=2094742*Lord Shonn Bayerleyn in Armour}\n\n\n{link*http://bayerleyn-retinue.enjin.com/gallery/m/20022497/detail/177249#pid=2182736*Lord Shonn Bayerleyn and a Grey Owl}\n\n\n{link*http://bayerleyn-retinue.enjin.com/gallery/m/20022497/detail/177249#pid=1655637*Lord Shonn Bayerleyn relaxing}\n\nAlternatively:\ntinyurl.com/ShonnAD1\ntinyurl.com/ShonnAD2\ntinyurl.com/ShonnAD3\n\nYou can find more Art at:\ntinyurl.com/BayerleynGallery\n\n\n\n",
