				["Elliwood-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-paladin-cover:256:256}\n\n{h1:c}Elliwood Donia{/h1}\n\nElliwood Donia, born in Hillbrad Foothills in a mansion north from Tarren Mill. His father, Alphonse Donia, Paladin, Commander of the Scarlet Crusade and Lord of House Donia. And his mother, Mira Blackthorne, a noble's daughter, had two sons together named, Elliwood and Eddard Donia.\n\n\nEarly years:\nElliwood was always fond of his father. His big dream was to become a paladin just like him. One time his father walked up to him and said that he could go with him to Tyr's Hand. The young boy couldn't have been happier and went with his father. It was there where he found the Light. From that day he would train to become a paladin, but it wasn't going as planned. The Scarlet Crusade got corrupted from within and he and his father fled back home.\n\n{img:Interface\\FlavorImages\\ScarletCrusadeLogo:256:256}\n\nMid years:\nThe young man grew and grew. And so did his devotion to the Light. Everyday he trained, together with his brother and everday he prayed, growing stronger and stronger.\nOne day his father went terribly ill, as if he was infected with something. Days and days past. And the state of his father would go down with the day. And then on a silent night, Alphonse Donia died. His family mourned for days and at this moment Elliwood had to take the mantel of Lordship. He wasn't prepared for this, but did it out his family's and fathers sake.\n\nYears past and the younf Lord wasn't happy with his position. The world was being threatened and he wanted to go out and help others, but his brother didn't agree with his decision. He said that Elliwood should keep his place as Lord and taking care of his family. Elliwood responded by giving his brother the Lordship of the House and left. His brother was furious about this. He would forever hate his older borther for just leaving and letting everyone he once cared about behind.\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-GenBeauregardsLastStand:512:256}\n\nPresent:\nNow Elliwood roams the world. Taking on various jobs and helping other others with their missions or problems, like when he was part of the Crowders and Lighthearts. Later on he even made his own mercenary group called \"The Silverbane Order\". He will forever have the thought of his past dicision in his mind and will forever carry his duties of the Light. \n\nThe past few years where heavy. Losing friends, family and even parts of himself. But besides all that he still tries to make the best out of his life. This however didn't take long as he had a breakdown, not knowing who he was anymore and almost losing all hope in the Light. He renamed himself Rover and went to wander the world, waiting for his day to come. Only being a phantom of his former self, carrying his face but not his soul.\n\n\n",
				},
