			["time"] = 1496789776,
			["zone"] = "Stormwind City",
			["about"] = {
				["v"] = 13,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1}Background{/h1}\nBastian doesnt remember much from his life, be it places or people; he woke up in the medical center of Stormwind being very confused; his head bandaged and scarred and he had a swirling headache. Slowly he is starting to discover bits about his past, but is still far away to remember who he is and what has happened to him in order to solve the puzzle; however, he is certain about his name and age. He spends alot of his time in the Stormwind Keep, perusing files and books trying to search for details about his life, and maybe even his family.\n\n{h1}Personality{/h1}\nBastian is a gentle, helpful and polite guy, albeit cautious. He is protective and faithful and will usually be loyal towards anyone who gets on his good side - but especially towards his superior/employer, whom he would give his life for if he had to. He has the soul of a poet and is a bit of a dreamer and romantic, old-fashioned would be a better word. The fact that he is challenged in terms of his past and memory has left him shy. \n\n{h1}Looks{/h1}\nBastian is tall, above average in height and has the physique of a soldier; heavy set but not extremely muscular.\nHis long brown hair is often up in a ponytail, with long soft looking, thick strands draping down on his shoulders. Bastian has pale blue eyes with a tint of grey; they have a gentle but playful look to them. He sometimes wears smudged black eye liner. His face is weathered, a few scars here and there scattered under the stubble, stubble is long enough to be soft to touch, across high cheekbones and a sharp jawline. While cheeky at times with those he knows, he does not often walk around with a smile on his face as he only shows emotions to people close to him, he is closely guarded.\n\n{h1}Misc. Info{/h1}\nCustomised/personalised artwork: {link*http://imgur.com/a/4Knr3*Bastian Gregory - \"Before The First Battle\"}.\n \nLink to artist: {link*http://belvane.deviantart.com/gallery/*Belvane on Deviant Art}.\n\nVoice: Russell Crowe.\n\nTheme: \"Colin Frake\" - Two Steps From Hell.\n\nVery approachable and friendly IC/OCC, whispers welcome, but I ignore lollers, trolls, morons and rude folks.\n\nNot interested in joining a guild.\n\nIf my status is set to AFK I really -am- AFK.",
				},
