				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Weary Wolf",
						["IC"] = "Ability_Mount_WhiteDireWolf",
						["TX"] = "Jarnus is ancient, his skin harsh and leathery, his fur grey and matted, were it not for the curse of the worgen he would undoubtedly have no hair.\n\nDue to the various troubles of the elderly, Jarnus is not only pitifully slow and weak physically. But he is in a permanent hunchbacked position and requires a cane to walk. Even the strengths of the worgen curse cannot keep an individual spry forever.\n\nHis eyes are sunk in, unnaturaly so. Furthermore, surely no man should be able to walk in his physical state, even with the aid of canes?",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Satchel of Essentials",
						["IC"] = "INV_MISC_BAG_09",
						["TX"] = "Jarnus carries a small leather satchel with him wherever he goes, carrying the essentials.\nSuch as:\n- A book, \"The Peasant of Westfall\"\n- A diary, with a lock and key.\n- A sandwich.\n- Some water.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Walking Cane",
						["IC"] = "INV_Staff_80",
						["TX"] = "One of the many downsides to being quite as ancient as Jarnus is, is the loss of one's bodily functions. Weaker bowels, joints, bones. The list goes on.\n\nTo this end, Jarnus has gotten himself a fine little cane he uses for leaning on and walking with. He leans on it as if his life depended on it. The cane is nothing fancy and was bought from a Stormwind woodworker.",
					},
