				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-GenBeauregardsLastStand:512:256}\n{h2:c}Silver-Blood{/h2}\nThe people tolds him \"Silver-Blood\" but why? He was a poverty before, he has to find some silvers for foods and drinks. Maybe womens or whiskeys. But he has nothing. He just had his sword and sword abilities. One day he hear something about this \"Pit Fights\" and he checked some informination about pit fights, after this he found the place for a fight, and he use his sword to kill. He got so many golds, silvers and coppers. But he has so many blood in his hands too. B'cause of this people told him \"Silver-Blood\" but now, he purify himself and turn back to his own destiny to The Redridge Knights. He use his sword for the Alliance and for his motherplace.\n{img:Interface\\LFGFRAME\\LFGICON-DUNGEON:256:256}\n\n{h1}COMING SOON{/h1}",
