			["about"] = {
				["v"] = 44,
				["BK"] = 9,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}\n\n{h1:c}{col:ff4400}Yvon Hastings{/col}{/h1}\n\n{icon:Ability_Fixated_State_Red:25}{col:ff0100}\nPERSONALITY:\n\nOn the outside, Yvon is a very hardened and matter of fact person. She has very little patience for those she does not like or trust and won't hesitate to speak her mind or cut them down. Her temper can fray very easily, and those on her bad side, would really not want to be there for the fallout.\n\nThat said, when one gets to know her, they would find she is actually a vey gentle and caring person. She has the utmost respect for those she holds most dear and would not hesitate to risk her life to save theirs.\n\nShe makes a great listener to those that occasionally need someone to confide in or perhaps even a shoulder to cry on. Her comfort is second to none but she remains honest and truthfull. Being loyal, she is able to keep a secret and not tell a soul should she be entrusted to such.\n\nShe is a very loyal women and any partner that would be so fortunate to take her hand, would find that they not only had a spouse but a friend for life.\n\n{/col}\n\n\n{icon:Boss_Odun_Orange:25}{col:ff8843}\nAPPEARANCE:\n\nYvon is a medium height, meduim/slim build women for her age. She is typically feminine and mostly has her dark red hair tied back for convenience.\n\nShe wears a leather eye patch on her right eye at all times due to a severe injury rendering her unable to see through it. \nUnder the patch her eye would be a milky pink colour with barely an iris visable in the blended mess.\nGiven the fact she only has the use of one eye, she has developed extremely fast reflexes and never lets it impead her performance.{/col}\n\n\n{icon:Boss_OdunRunes_Yellow:25}{col:fbff54}\nJEWELLERY & ACCESSORIES:\n\nShe can always be seen wearing her mothers choker, it has a band of black suede leather which would sit close to the skin on her neck and a bright red ruby shard which hangs daintily from it.\n\nShe wears a wide leather belt that can accomodate a host of attachments, most notably the sheaths for her trusty blades. In these would most often be found the Katana blade and a matching dagger. It aslo holds her coin purse, hip flask and a pocket knife.\nAround her body can ofter be seen, a small leather satchel that she keeps an array of usefull daily items in.\n\nHer sword originated from the ancient isle of Pandaria where her father earned the trust and respect of a dear friend on his travels. The sword was a gift to him apon his leavingthe isle.\nThe sword is made of an unknown metal, on the hilt and base of the blade are engraved markings of unknown origin.\n\nApon Yvon's comming of age, her father passed it down to her. The dagger she accompanies it with, was made in the great forge and is of no intrinsic value.\n\n{/col}\n\n\n{icon:Boss_OdunRunes_Green:25}{col:00d720}\nABILITIES:\n\nYvon has a limited skill set, though through some basic training and having done some freelance contract killing type employment. She knows how to handle herself in a typical physical situation. That said, her knowledge of the magic world is very narrow as she struggles to understand it at the best of times.\n\nShe is proficient with hand to hand combat and specialises in using swords and daggers. Her small stature and light weight make her agile and quick on her feet. Her reactions are second to none and her basic first aid can assist in quick medical situations should they arise.\n\n{/col}\n\n{icon:Boss_OdunRunes_Blue:25}{col:3aa0ff}\nAMBITIONS:\n\nYvon is a very driven person and has a good head to succeed in all aspects of her life. She always give her best at everything she does and has a great desire to help people in anyway she can.\n\nIn her position of employment, she see's herself being a successful member to a good cause, being able to contribute her skills to whatever the objective and making some good friends that she can trust along the way.\n\nUltimately though, Yvon deep down, dreams of eventually  hangin up her armour in favour of raising a family. Being an only daughter and child, her desire to continue her family bloodline is strong, she has a very maternal heart under her hardened exterior personality.\n\nDespite this, her future has yet to unfold, no one could predict how things will evolve. So many paths and choices in her life await, what will she decide?\n\nThe future is yet to unfold.......\n{/col}\n\n{icon:Boss_OdunRunes_Purple:25}{col:ab6cff}\nBRIEF HISTORY:\n\nOriginally born in Gilneas, as a young girl of only six years. Born from a wealthy family of noble blood she was taught etiquacy and how to speak of proper proportions.\nApon invasion of Gilneas, her family fled their home and city to the far reaches of the south where they resided apon the city of Stormwind.\n\nSadly in this transition, both she and her mother where biten and infected with the dreaded curse, forcing apon them the ever morphing changes to their innocent fragile bodies.\n\nThough her mother and father quickly found a tempory cure which was coutesy of the great minded Gnomes of the north. Here they was able to make a suitable antidote that was delivered by weekly injectable vials to surpress the morphic changes to her body.\nNot long after the antidote was made, her mother sadly passed away.\nThe struggles of family life in a city that felt alien to them and the curse took it's toll on her and was the main contributor that unfortunatelly took her life.\n\nYvon's family has a known, rare blood type which renders most cures to ailments quite a danger to their lives if not altered to accomadate their needs.\nShe has had many a severe, allergic reaction to such potions and other means of medicines.\n\nIn Yvon's early schooling years, the other children would make fun of her and the parents of said children would never let them play alongside her for fear of the curse. This made growing up in her new city very difficult, her father turned to drinking after her mother died and could not cope with life.\n\n{/col}\n\n\n\n{img:Interface\\BlackMarket\\BlackMarketSign:256:128}",
