			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "Before you stands a tall, proud and handsome woman. Her skin a rich teakwood and her wavey hair  as dark as night, just past her ears.\nEzohika's face is feminine with hints of androgynous, angular features; elaborating further, her jaw is sharp and her eyes are striking, contrasting the dark skin around them with the brightness of her iris' current shade, be it brown or gold. Her lips are pillowy, soft and rich. An element of cuteness is held within the freckles blanketting her button nose, but that's about as far as it goes.\n\nEzohika's body is toned, slim and pear-shaped all at once. She stands strong, and walks firm with muscular legs from travelling far over Azeroth, and her arms are detailed lightly with scars from past battles.\n\nEzohika's Worgen form is foreboding at best, though there is a sense of humanity in her striking, golden eyes. You would be able to tell whether Ezohika's been in her Worgen form due to the same brightness lingering in her iris, as well as her canine teeth being slightly larger than prior to her change in form.",
