				["FT"] = "Farmer |||| Shapeshifter |||| Leatherworker",
				["HE"] = "192cm",
				["WE"] = "Broad and tall",
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-druid-cover:256:256}\n\nDear diary...\n\nThis has been most difficult then I thought... After I escaped from the horrors of Gilneas it seemed that life will return to normal and it did. For awhile atleast.. I forgot you for awhile and it seems I have the need to talk with someone, well write for you... I'll write everything that I've seen and experienced so I can memorize it for eternity. \n\nI met a merry crew of privateers three days ago, they sail a ship called the Dainty Damsel. I bumped into them while I was looking for merchants who would be interested in my wares, instead I find the Dainty Damsel and her crew! The captain had a strong pirate accent and he seemed stern and serious, after abit of chit-chat he eased up and I found out the true nature of this ship. They weren't some grizzled veterans of war but simple people looking for adventure and booty. After the formalities I met with the crew and I went on a ale run. It proceeded as usual get the ale and get back. After that the medical examination awaited... Like before it was like it was, get naked, talk to the doctor and bla-bla and then get your clothes back on. And thus was my first day on the Damsel, pretty promising, don't you think?",
				},
