					["3"] = {
						["AC"] = true,
						["TI"] = "Belt.",
						["TX"] = "On his belt you can see some bags, an axe, a hammer, his gloves if he's not wearing them and some charmes tangling on the left side of his belt. He sometimes has a lantern strapped to his belt... \n",
						["IC"] = "INV_BELT_102",
