					["TX"] = "{h2:c}Physical Description{/h2}\n\nHead / Face: \n\nAs one gaze's upon this lads face, he'd be rather youthful - No scars, blemishes or any other deformities dot his face but if one would be close, his tusks would poke out of the edges of his lips.\n\nHis ears would be common for someone of his kind, pointed up like any Orcs. \n\nTorso:\n\nHis general physique seems to be well kept and well looked after, musucles defined but not big, just enough to show he's getting there - If one spots him without a short or general clothing, two scar marks are seen upon his stomach, made by deep stab marks.\n\nHis skin colour would stand out, however. No matter where you may look over him, his skin colour would be a mix greenish - yellow, showing his Orcish heritage more so than anything \n\nVoice: \n\nHe seems to be deep in terms of voice but generally soft spoken with the hints of a Darnassian accent.\n\n",
