			},
			["character"] = {
				["CO"] = "- Always up for RP! -\n\nAny shapedshift form = OOC",
				["RP"] = 1,
				["v"] = 37,
				["XP"] = 1,
				["CU"] = "-  Annoyed.",
			},
			["zone"] = "Stormwind City",
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h2:c}{col:4951b9}Theadan Thunderstrike{/col}{/h2}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{col:4951b9}Infront of you stand Theadan, a tall night elf with cold eyes. His face is square formed with perfect jawlines that are covered in his thick, short beard. The elf's eyes shines in silver and will look upon you with a cold and bored look. His expression over all is more or less pure boredom, but don't let that fool you.\nTheadan is missing half of his left ear that seems to have been cut off. \n\nThe elf has long, blue hair that he keeps in a pony-tail. The hair goes down to his waist, looking and feels soft. Theadan usually wears a hood that covers his hair and face up as he is not the biggest fans of big crowds.\n\nTheadan stand 2.25 meter tall with a muscular body. Expect from his ear there is no other scar on his body. He is seen in leather outfits, mostly sleeveless shirts to show off the two sleeve tattoo on his arms. His right arm has an owl, sitting on a branch that is surrouned by a night sky. The left arm is a wolf, howling to the moon.\n\nIn his belt rests two bigger blades and around the whole belts lies smaller throwing knives. There would be no other visible weapon on his body.{/col}\n",
				},
