						["TX"] = "Morris' right hand can be shaking at times when he is either nervous, angry, or under stress. Eyes blinking rapidly and he can sometimes be seen scanning nearby rooves for some reason. \n\nMorris' can be set off by, sounds, smells, or being surprised by a sudden hand on his shoulder, or his name being called out. His mood sometimes swings from being angry, sad, and then back to a calmer state.. But if he is with someone he trusts or loves he is usually alright. \n\n",
