						["TI"] = "Facial Features",
						["IC"] = "ACHIEVEMENT_BOSS_KINGYMIRON_03",
						["TX"] = "Morris' hair is a curtain style haircut which is parted down the middle. Has a full goatee that is thin and not an uncontrollable bush, well trimmed and combed. Its obvious that he takes some time each day to make himself look presentable.\n\nMorris' complexion is pale but he is not pure white, he has some color. A pink scar can be seen on his right cheek, its large and visible. \n\n",
