			["zone"] = "Stormwind City - The Canals",
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}Description{/h1}\n\n{img:Interface\\BattlefieldFrame\\UI-Battlefield-Icon:120:120}\n{p:c}Morris stands at a height of six feet and four inches; possessing a medium muscular build, not a hulking brute, or a weak twig. His chest, abdomen, back, and thighs have scars here and there as if there was a connect the dots sheet on his skin. Immediately a scar would be noticed on his right cheek that stops just at the bottom of his eye, either from a dagger, or a claw tearing into his cheek. On his upper chest two blows from swords can be seen crossing over one another to make a 'T' shape; while deep claw marks can be seen from a past encounter with a feral. Moving down to his abdomen you'd find a small scar from either an axe or spear on his left side while on his right would be a small circular hole from a bolt or bullet. His outer thighs have multiple scars that can be seen if you were to ever see his legs; one his right thigh you can see three seperate scars from sword blows while on his left can be seen something close to a shrapnel wound. Morris' then has gruesome scarring on his upper back and lower neck from a small knife repeatedly digging into his skin, the word 'COWARD' can be seen which was obviously carved into him during a torturish session. Moving to his middle and lower back two circular scars can be seen from being shot by either a bolt or bullet, near where his right kidney would be located. The man having suffered through many of battles, fights, and other situations.. \n{img:Interface\\Calendar\\MeetingIcon:128:128}\nMorris' is usually seen with a forced smile on his face when around friends and others not wishing to make people uncomfortable with frowns; however Morris can be seen with genuine smiles, but only a couple people can bring it out of him. Morris' dark blue cerulean orbs sit perfectly on his face, surrounded by a milky white cornea. Inbetween his perfectly set eyes would be a wider then normal nose as a result of it being broken more then once; however the wideness of his septum is not unusual or disgusting to look at, but noticeable. Morris' lips have a pronounced cups bow with a light pink coloration; behind his lips would be white teeth usually hidden from most people, but if you did see them it would be obvious that the man cared and brushed them frequently. Morris' is very hygienic and thoughtful when it comes to his looks especially his facial hair and the hair ontop of his head. Morris facial hair is well trimmed and he is usually seen with a goatee or nothing at all, graced by a dark copper color; having been clipped and trimmed by scissors and razors to make it look presentable, attractive, and controlled. But the hair ontop of his head is usually combed into a classic crewcut or a middle parted hair style; unless he is on a trip or out on the road his hair is well tended to and looked after. On top of looking clean he would smell clean as well dreading the smell of sweat or other stenches from his time in the armed forces; covering his body in crushed up mint leaves which obviously results in him smelling subtly of mint upon getting closer to him, whenever he gets a chance to bathe he does. \n{img:Interface\\Challenges\\challenges-bronze:256:256}\nHis clothing changes from day to day but is usually seen in comfortable but presentable clothing when just wandering about; however, if he is heading out for a party or a fancy occasion he is always wearing a mixture of a beige and grey tailcoat. His armor does not look heavy and is obviously practical for fighting and defense. Choosing to wield either a two handed sword or a one handed sword and a shield. {/p}\n\n{h1:c}Artwork/Links and History{/h1}\n{link*https://www.argentarchives.org/node/125456*Argent Archives and History}\n{link*http://imgur.com/a/ocpTg*James breaking down during a battle}\n{link*http://imgur.com/a/78Fzt*James meeting his bestfriend Marci for the first time}\n{link*http://surealkatie.deviantart.com/*SurealKatie: Recommended Artist}\n{link*http://escalusia.tumblr.com/*Escalusia: Recommended Artist}\n\n\n\n\n\n\n\n\n",
