		["1025015630p~wu4"] = {
			["character"] = {
				["CO"] = "Ignores the usual!\n\nArt n' AA page in about\n\nThe Ashen Covenant is recruiting! Do ask for information, should you be interested",
				["RP"] = 1,
				["v"] = 56,
				["XP"] = 2,
				["CU"] = "Brandishing his cane proudly, humming a sweet tune to himself",
			},
			["time"] = 1496786646,
			["link"] = {
				["Derán-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 55,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:ff0100}Please note this is all placeholder text, it's all temporary, so expect change!{/col}\n{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n{h1:c}Emmet, A. Hemmingway{/h1}\n\nEmmett is a priest, a man devoted to the light! His life has mainly consisted of relentless training, studying and working to be the best he can be. And after nearly sixty years of training, he has become an immaculate healer! \n\n\n\n{h1}Physical discription{/h1}\nEmmett is an older man, with the looks to back it. His face carries a varity of wrinkles and mark. But, disipte his old age, he looks to be rather healthy. \n\nHis face is long, his eyes have a slightly tired look to them, but his mouth is always curled into a soft, calm smile. Above said mouth is a moustache, like his hair it has gotten a grey colour over the years, but it's still as healthy as the day it was grown!\n\nHis body is slim, and well maintained. But of coure it's all hidden under the heavy robe he dons. Said robe looks to be hand sewn to fit his body, it has a couple armor plates, just to help him to not be completely useless against weapons. The fabric of the robe is a reinforced cloth, helping to keep him warm, but also offer -some- protection!\n\n\n\n{h1}His story{/h1}\nYou will know after interacting with him for a while, he´is a talkative man, eager to share his stories!\n\n{link*http://imgur.com/a/XuUcL*Art for those too lazy to visit AA}\n{link*https://www.youtube.com/watch?v=gyoIQqnzWn0*My AA page}\n{link*http://tinyurl.com/ThemeSongarinoMan*An actually originally made themesong!}\n",
				},
			},
			["misc"] = {
				["PE"] = {
					["5"] = {
						["AC"] = true,
						["TI"] = "Limping",
						["IC"] = "INV_Misc_Bone_03",
						["TX"] = "The old man seems to limp quite a bit. It would be a miracle to see him run!",
					},
					["1"] = {
						["AC"] = true,
						["TI"] = "Golden tome",
						["TX"] = "A large, heavy looking tome hangs at the priests side. The oversized book is filled to the brim with spells and other fancy gimmicks that could prove useful in combat",
						["IC"] = "INV_7XP_Inscription_TalentTome01",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Cane",
						["TX"] = "Emmet walks a tad funny after a certain incident in battle quite some time ago. This restulted in him needing a cane to walk over longer distances!\n\nThe cane is a simple oaken construction, minor decorations scattered on it's length",
						["IC"] = "INV_Relics_6oRunestone_OrcSpeakingStaff",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Robes",
						["TX"] = "The old man is clad head to toe in a thick, decorated robe. It looks to have been through a good bit of ruffle and tuffle, but overall it looks rather well maintained!\n\nScattered on the robe is small, lightweight plates of armor to not leave him completely susceptible to weapons!",
						["IC"] = "INV_Robe_Leather_RaidMonk_N_01",
